module Day5 where

import Data.List
import Data.Char

inputData :: String
inputData = ""
inputDataS = "dabAcCaCBAcCcaDA"

opPol :: Char -> Char -> Bool
opPol c1 c2 | c1 /= c2  && toLower c1 == toLower c2 = True
            | otherwise = False

filterOpPol :: String -> String
filterOpPol [] = []
filterOpPol [x] = [x]
filterOpPol (x:y:xs)    | opPol x y = xs
                        | otherwise = x : filterOpPol (y:xs)

getFp :: String -> String                        
getFp xs    | length xs == length ys = xs
            | otherwise = getFp ys
            where ys = filterOpPol xs


